alta juurta, alta no juurta vesi joosi,
päältä latvu, päältä nu latvu päivä paisti/paistsõ,
kasvi tammi, kasvi siis/jo tammi taivahe,
vaher valgõ, vaher nu valgõ pilve mano/pääle,
kiä lätsi/tammõlt, kiä läts´ tammõlt taivahe,
näio tammõlt, näio läts tammõlt taivahe,
vahtralt valgõ, vahtralt läts´ valgõ pilve pääle.
Mille näio, mille läts´ näio taivahe?
Mõtõl´ kuud, mõtõl´ tä kuud kosilasõs,
päivä meestä, päivä nu/jo meestä meelelidses/meelelises.
Saa-as´ kuust, saa-as´ täl kuust kosilaista,
pääväst meestä, pääväst saa-s meestä meelelistä.
Kuu oll´ kummõr, kuu oll´ kummõr, sis oll´ kuri,
kuu oll´ tsirpi, kuu oll´ tsirpi, sis oll´ terräv,
päiv palot´, päiv ar palot´ näio palgõ,
kulõht näio, kulõht ar näio kulmukõsõ.
Tahtsõ taivast, tahtsõ tä taivast tagasi,
saa-as taivast, saa-as tä taivast tagasi,
pilvelt maalõ, pilvelt saa-as maalõ maa pääle.
Tammi-ks murrõh, tammi oll´ murrõh/murrõl murdunu,
vaher vette, vaher oll´ vette (vee-et-te) vaonu.
Määne-ks murõh, määne no murõh murd´ tammõ,
kohe-ks vette, kohe nu/jo vette vaiu vaher?
Ime-ks murõh, ime no murõh murd´ tammõ,
silmä-ks -vette, silmä nu/jo vette vaiu vaher.
