on":30,"duration":"4n"}],"order":6}]}',80,-4,'Kadrikasõ, kudrikasõ, kadrikoo, kadrikoo.        Dear St Catherine''s Day mummers.
Kost kadri'' siiä tulli'', kadrikoo, kadrikoo?     Where have the mummers come from??
Kadri'' tulli'' kavvõndõsta, kadrikoo, kadrikoo,   The mummers came from far away,
läbi suu ligõda,                                 Through the wet swamp,
läbi pikä pilliruu,                              Through the tall reeds,
läbi kalõ kastõhaina.                            Through the coarse bentgrass.
Pilliruugu silmä'' pisti,                         The reed pricked our eyes,
kastõhaina kaala lõigas.                         The bentgrass cut our necks.
Kadri omma'' toolta maalta, (kergütämine)         Kadri come  from yonder lands
koh kurõ'' kulda süüvä'',                          Where the cranes feast on gold
hani'' hal´ast hõbõhõta.                          Where the geese nibble on silver
Tulli läbi pikä mõtsa,                           We came through the long forest
tulli korgõ kuusõmõtsa,                          We came through the spruce woods
kuusõnõgla'' kurku lätsi'',                        Spruce needles stuck in our throats
kadajanõgla'' kaala tulli'',                       Juniper needles scraped our necks
pähnälehe'' pääle joosi’.                         Lime leaves fell onto our heads
Kuulõ'', peenü perenaane,                         Listen, dear lady of the house,
pääle peenü peremeesi,                           And you, kind master of the house,
lasku-i olla'' ussõ takah,                        Do not let us linger behind the door,
lasku-i saista'' saina takah -                    Do not let us stand by the wall 
kadri küütse'' külmäse'',                          Our nails are freezing
kadri varba'' valutasõ''.                          Our toes are aching
Tere, ahi, amm-suu,                              Greetings to the oven, wide-mouthed one,
tuhkhaud, tulimulk!                              Greetings to the hearth, fire-pit!
Kuulõ'', peenü perenaane,                         Hear us, dear lady of the house
anna'' liha lipsokõnõ,                            Give us a little meat
anna'' villo veid´okõsõ,                          Give us a little wool
anna'' rasva raasakõsõ!                           Give us a bit of grease
Kadrikasõ, kudrikasõ!                            St Catherine''s day mummers!

